import React from "react";
import pic from "../assets/Profilepic.png";
const Chat = () => {
  return (
    <div className="h-auto w-screen flex flex-col">
      {/* header */}
      <header className="w-full h-[20rem] bg-white">
        <div className="w-[90%] h-[90%] mx-auto my-auto">
          {/* profile */}
          <div>
            {/* icons */}
            <div></div>
            {/* profile,name */}
            <div>
              {/* photo */}
              <div className="rounded-full">
                <img
                  src={pic}
                  alt=""
                  className="h-[2.75rem] w-[2.75rem] rounded-full"
                />
              </div>

              {/* name */}
              <div></div>
            </div>
          </div>

          {/* languages */}
          <div></div>
        </div>
      </header>

      {/* messages */}
      <div></div>
    </div>
  );
};

export default Chat;
